import React, {useState} from 'react';
import './App.css';
import {SuperCounter} from "./SuperCounter";
import {MaxMInValue} from "./MaxMInValue";


function App() {


    const [value, SETValue] = useState(0)
    const [disable, SetDisable] = useState(5)


    const Inc = () => {
        SETValue(prevState => prevState + 1)
    }

    const Reset = () => {
        SETValue(0)
    }

    const Set = (Max: number, Min: number) => {
        SETValue(Min)
        SetDisable(Max)
    }
    return (
        <div className="App">

            <MaxMInValue set={Set}/>
            <SuperCounter inc={Inc} value={value} reset={Reset}/>

        </div>
    );
}

export default App;
